CREATE TABLE `music` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `track_name` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `duration` varchar(15) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `album_id` bigint(20) unsigned NOT NULL,
  `performers_id` bigint(20) unsigned NOT NULL,
  `added_user_id` bigint(20) unsigned NOT NULL,
  `created_at` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`id`),
  KEY `album_id` (`album_id`),
  KEY `performers_id` (`performers_id`),
  KEY `added_user_id` (`added_user_id`),
  KEY `music_track_name` (`track_name`),
  CONSTRAINT `music_ibfk_1` FOREIGN KEY (`album_id`) REFERENCES `album_music` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `music_ibfk_2` FOREIGN KEY (`performers_id`) REFERENCES `performers_music` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `music_ibfk_3` FOREIGN KEY (`added_user_id`) REFERENCES `users` (`id`)
